import React from 'react';
import { Table } from 'react-bootstrap';
import styles from './Protection.module.css';

const ViewProtectionSchedulePersons = ({ general_work_protection_list, personal_work_protection_list, students_list, request_list }) => {
  const formatDate = (date) => {
    const options = { day: 'numeric', month: 'long', year: 'numeric' };
    return new Date(date).toLocaleDateString('ru-RU', options);
  };

  const getFullName = (studentId) => {
    const student = students_list.find((student) => student.user.id === studentId);
    if (student && student.user) {
      const { last_name, first_name, patronymic } = student.user;
      return `${last_name} ${first_name} ${patronymic}`;
    } else {
      return 'Unknown';
    }
  };

  const distributeStudentsByProtectionDays = (generalList, personalList) => {
    const groupedSchedule = {};

    // Combine general and personal protection lists
    const allProtectionList = [...generalList, ...personalList];

    allProtectionList.forEach((item) => {
      const dateKey = formatDate(item.date);
      const groupName = item.group ? item.group.name : 'Unknown';
      const groupId = item.group ? item.group.id : null;

      if (!groupedSchedule[dateKey]) {
        groupedSchedule[dateKey] = {};
      }

      if (!groupedSchedule[dateKey][groupName]) {
        groupedSchedule[dateKey][groupName] = { day1: [], day2: [] };
      }

      const currentGroup = groupedSchedule[dateKey][groupName];

      // Find students related to this protection event
      const relatedStudents = request_list.filter((request) => request.work_protection === item.id);

      // Distribute students between day1 and day2
      const day1Students = relatedStudents.slice(0, 12); // First 12 students for day1
      const day2Students = relatedStudents.slice(12, 24); // Next 12 students for day2

      // Add to the respective days
      currentGroup['day1'].push(...day1Students);
      currentGroup['day2'].push(...day2Students);
    });

    return groupedSchedule;
  };

  const groupedSchedule = distributeStudentsByProtectionDays(general_work_protection_list, personal_work_protection_list);

  return (
    <div>
      <h4 className='text-center'> График защит ВКР по фамильный</h4>
      <div className='mx-md-5'>
        {Object.entries(groupedSchedule).map(([date, groups]) => (
          <div key={date}>
            <h3>{date}</h3>
            {Object.entries(groups).map(([group, days]) => (
              <React.Fragment key={group}>
                {days.day1.length > 0 && (
                  <Table bordered hover responsive className={styles.protectionTable}>
                    <thead>
                      <tr>
                        <th>ФИО</th>
                        <th>Группа</th>
                        <th>Дата</th>
                      </tr>
                    </thead>
                    <tbody>
                      {days.day1.map((request, index) => (
                        <tr key={index}>
                          <td>{getFullName(request.student.user.id)}</td>
                          <td>{group}</td>
                          <td>{date}</td>
                        </tr>
                      ))}
                    </tbody>
                  </Table>
                )}
                {days.day2.length > 0 && (
                  <Table bordered hover responsive className={styles.protectionTable}>
                    <thead>
                      <tr>
                        <th>ФИО</th>
                        <th>Группа</th>
                        <th>Дата</th>
                      </tr>
                    </thead>
                    <tbody>
                      {days.day2.map((request, index) => (
                        <tr key={index}>
                          <td>{getFullName(request.student.user.id)}</td>
                          <td>{group}</td>
                          <td>{date}</td>
                        </tr>
                      ))}
                    </tbody>
                  </Table>
                )}
              </React.Fragment>
            ))}
          </div>
        ))}
      </div>
    </div>
  );
};

export default ViewProtectionSchedulePersons;
